import React, { useEffect, useState } from "react";
import API from "../api";

function Dashboard() {
  const [analytics, setAnalytics] = useState({});
  const [products, setProducts] = useState([]);
  const [newProduct, setNewProduct] = useState({
    title: "",
    price: 0,
    discount_percentage: 0,
    quantity: 0,
    product_id: 0
  });
  const [loading, setLoading] = useState(false);

  // Load analytics and products
  const loadAnalytics = async () => {
    try {
      const res = await API.get("/analytics");
      setAnalytics(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const loadProducts = async () => {
    try {
      const res = await API.get("/products");
      setProducts(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    loadAnalytics();
    loadProducts();
  }, []);

  // Import products from external API
  const handleFetchCarts = async () => {
    setLoading(true);
    try {
      await API.post("/fetch-carts");
      alert("Products imported successfully!");
      loadAnalytics();
      loadProducts();
    } catch (err) {
      console.error(err);
      alert("Failed to import products. Check console for details.");
    } finally {
      setLoading(false);
    }
  };

  // Add new product
  const handleAddProduct = async () => {
    try {
      await API.post("/products", newProduct);
      setNewProduct({ title: "", price: 0, discount_percentage: 0, quantity: 0, product_id: 0 });
      loadAnalytics();
      loadProducts();
    } catch (err) {
      console.error(err);
      alert("Failed to add product");
    }
  };

  // Delete product
  const handleDeleteProduct = async (id) => {
    try {
      await API.delete(`/products/${id}`);
      loadAnalytics();
      loadProducts();
    } catch (err) {
      console.error(err);
      alert("Failed to delete product");
    }
  };

  return (
    <div style={styles.container}>
      <h1>Dashboard & Product Management</h1>

      <button style={styles.importButton} onClick={handleFetchCarts} disabled={loading}>
        {loading ? "Importing..." : "Import Products"}
      </button>

      {/* Analytics Cards */}
      <div style={styles.cardsContainer}>
        {analytics && Object.keys(analytics).length > 0 &&
          Object.entries(analytics).map(([key, value]) => (
            <div key={key} style={styles.card}>
              <strong>{key.replace(/_/g, " ").toUpperCase()}:</strong>{" "}
              {typeof value === "number" ? value.toFixed(2) : value}
            </div>
          ))}
      </div>

      {/* Add New Product */}
      <div style={styles.newProductContainer}>
        <h2>Add New Product</h2>
        <input
          style={styles.input}
          placeholder="Title"
          value={newProduct.title}
          onChange={(e) => setNewProduct({ ...newProduct, title: e.target.value })}
        />
        <input
          style={styles.input}
          type="number"
          placeholder="Price"
          value={newProduct.price}
          onChange={(e) => setNewProduct({ ...newProduct, price: parseFloat(e.target.value) })}
        />
        <input
          style={styles.input}
          type="number"
          placeholder="Discount %"
          value={newProduct.discount_percentage}
          onChange={(e) =>
            setNewProduct({ ...newProduct, discount_percentage: parseFloat(e.target.value) })
          }
        />
        <input
          style={styles.input}
          type="number"
          placeholder="Quantity"
          value={newProduct.quantity}
          onChange={(e) => setNewProduct({ ...newProduct, quantity: parseInt(e.target.value) })}
        />
        <button style={styles.addButton} onClick={handleAddProduct}>
          Add Product
        </button>
      </div>

      {/* Product List */}
      <div style={styles.productList}>
        <h2>Product List</h2>
        {products.map((p) => (
          <div key={p.id} style={styles.productItem}>
            {p.title} - ${p.price} - Qty: {p.quantity} - Discount: {p.discount_percentage}%
            <button style={styles.deleteButton} onClick={() => handleDeleteProduct(p.id)}>
              Delete
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: 20,
    fontFamily: "Segoe UI, Tahoma, Geneva, Verdana, sans-serif"
  },
  importButton: {
    padding: "10px 20px",
    marginBottom: 20,
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontWeight: "bold"
  },
  cardsContainer: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
    gap: 20,
    marginBottom: 30
  },
  card: {
    background: "#1f2937",
    color: "white",
    padding: 20,
    borderRadius: 10,
    boxShadow: "0px 4px 6px rgba(0,0,0,0.2)",
    fontSize: 16
  },
  newProductContainer: {
    marginBottom: 30
  },
  input: {
    width: "200px",
    padding: 8,
    marginRight: 10,
    marginBottom: 10,
    borderRadius: 5,
    border: "1px solid #ccc"
  },
  addButton: {
    padding: "8px 16px",
    backgroundColor: "#2563EB",
    color: "white",
    border: "none",
    borderRadius: 5,
    cursor: "pointer",
    fontWeight: "bold"
  },
  productList: {
    marginTop: 20
  },
  productItem: {
    background: "#f3f4f6",
    padding: 10,
    marginBottom: 8,
    borderRadius: 6,
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center"
  },
  deleteButton: {
    background: "#DC2626",
    color: "white",
    border: "none",
    borderRadius: 5,
    padding: "4px 10px",
    cursor: "pointer"
  }
};

export default Dashboard;
